  found in the San Francisco Planning Code: http://planningcode.sfplanning.org(click
  on the links under ZONING MAPS on the left navigation column).A PDF map of the Zoning
  Districts can be found on the Planning Department's Map LibrarySummaries of the
  Zoning District codes can be found here:http://www.sf-planning.org/index.aspx?page=1580
